(10, 103, 'klinik gigi', 'jadwal-dokter', '<p>{slider=<strong><span style=\"font-family: \'andale mono\', monospace; color: #7e82df; font-size: 18px;\">Pemeriksaan Gigi Umum</span></strong>}</p>\r\n<p>Untuk mengetahui kondisi kesehatan gigi, gusi dan mulut baik anak-anak maupun dewasa</p>\r\n<p>{/slider}</p>\r\n<p>{slider=<span style=\"color: #7e82df; font-size: 18px; font-family: \'andale mono\', monospace;\"><strong>Penambalan Gigi</strong></span>}</p>\r\n<p>Disarankan agar fungsi kunyah dan estetika gigi tetap terjaga. Penting dilakukan pada gigi tetap maupun gigi susu</p>\r\n<p>{/slider}</p>\r\n<p>{slider=<strong><span style=\"color: #7e82df; font-size: 18px; font-family: \'andale mono\', monospace;\">Pembersihan Karang Gigi</span> </strong>(<span style=\"color: #7e82df; font-size: 18px; font-family: \'andale mono\', monospace;\">scalling</span>)}</p>\r\n<p>Dilakukan untuk membersihkan kalkulus dan plak yang menumpuk pada gigi</p>\r\n<p>{/slider}</p>\r\n<p>{slider=<span style=\"color: #7e82df; font-size: 18px; font-family: \'andale mono\', monospace;\"><strong>Pencabutan Gigi</strong></span>}</p>\r\n<p>Dilakukan jika gigi dalam keadaan rusak dan tidak dapat diselamatkan dengan penambalan gigi maupun perawatan saluran akar</p>\r\n<p>{/slider}</p>\r\n<p>{slider=<span style=\"color: #7e82df; font-size: 18px; font-family: \'andale mono\', monospace;\"><strong>Perawatan Saluran Akar</strong></span>}</p>\r\n<p>Dilakukan guna mengeluarkan saraf gigi yang telah membusuk. Dapat digunakan untuk mempertahankan gigi asli agar terhindar dari pencabutan</p>\r\n<p>{/slider}</p>\r\n<p>{slider=<span style=\"color: #7e82df; font-size: 18px; font-family: \'andale mono\', monospace;\"><strong>Pemutihan Gigi</strong></span>}</p>\r\n<p>Proses yang aman untuk mengembalikan warna gigi sehingga lebih putih daripada sebelumnya sehingga membuat tampil percaya diri</p>\r\n<p>{/slider}</p>\r\n<p>{slider=<span style=\"font-size: 18px;\"><span style=\"color: #7e82df; font-family: \'andale mono\', monospace;\"><strong>Kawat Gigi</strong></span> </span>(<span style=\"color: #7e82df; font-size: 18px; font-family: \'andale mono\', monospace;\">Orthodontic</span>)}</p>\r\n<p>Perbaikan susunan gigi yang kurang baik dengan menggunakan kawat gigi agar tampil lebih rapi dan teratur</p>\r\n<p>{/slider}</p>', '', 1, 2, '2023-05-04 13:38:12', 272, '', '2023-05-07 04:40:44', 272, NULL, NULL, '2023-05-04 13:38:12', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"0\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\",\"helix_ultimate_image\":\"\",\"helix_ultimate_image_alt_txt\":\"\",\"helix_ultimate_article_format\":\"standard\",\"helix_ultimate_audio\":\"\",\"helix_ultimate_gallery\":\"\",\"helix_ultimate_video\":\"\",\"spfeatured_image\":\"\",\"spfeatured_image_alt\":\"\",\"post_format\":\"standard\",\"gallery\":\"\",\"audio\":\"\",\"video\":\"\",\"link_title\":\"\",\"link_url\":\"\",\"quote_text\":\"\",\"quote_author\":\"\",\"post_status\":\"\"}', 26, 1, '', '', 1, 76, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 0, '*', ''),
