(51, 'index.php?option=com_content&view=article&id=10', 'index.php?option=com_content&view=article&id=10:jadwal-dokter&catid=2', 'klinik gigi', ' + - Pemeriksaan Gigi Umum Click to collapse Untuk mengetahui kondisi kesehatan gigi, gusi dan mulut baik anak-anak maupun dewasa + - Penambalan Gigi Click to collapse Disarankan agar fungsi kunyah dan estetika gigi tetap terjaga. Penting dilakukan pada gigi tetap maupun gigi susu + - Pembersihan Karang Gigi (scalling) Click to collapse Dilakukan untuk membersihkan kalkulus dan plak yang menumpuk pada gigi + - Pencabutan Gigi Click to collapse Dilakukan jika gigi dalam keadaan rusak dan tidak dapat diselamatkan dengan penambalan gigi maupun perawatan saluran akar + - Perawatan Saluran Akar Click to collapse Dilakukan guna mengeluarkan saraf gigi yang telah membusuk. Dapat digunakan untuk mempertahankan gigi asli agar terhindar dari pencabutan + - Pemutihan Gigi Click to collapse Proses yang aman untuk mengembalikan warna gigi sehingga lebih putih daripada sebelumnya sehingga membuat tampil percaya diri + - Kawat Gigi (Orthodontic) Click to collapse Perbaikan susunan gigi yang kurang baik dengan menggunakan kawat gigi agar tampil lebih rapi dan teratur ', '2023-05-07 04:40:44', '4b49491cb81b6a78ee28a714e3c464b2', 1, 1, 1, '*', '2023-05-04 13:38:12', NULL, '2023-05-04 13:38:12', NULL, 0, 0, 3, );
